import './card.css';
const card = ({name = "rakib",age = 18})=>{
    return(
        <div className="main_box">
            <div className = "sub_box1"></div>
            <div className = "sub_box2">
                <p>I am {name} i am {age} years old</p> 
            </div>
        </div>
    );
}
export default card;
